import { Link } from 'react-router-dom';
import posts from '../data/posts';
import '../Blog.css';

function Blog(){
    return(
        <>
            <header>

            </header>
            <main>
                <div class="tab_contents">
                    <ul id="contentsTab" class="list_tab">
                        <li>
                            <a href="#posts"><span class="txt_tab">Posts</span> </a>
                        </li>
                        <li>
                            <a href="log"><span class="txt_tab">Daily Development Log</span> </a>
                        </li>
                    </ul>
                </div>
            </main>
        </>
    )
} 

export default Blog;
